import React from 'react';
import Profile from "./Profile";
import axios from "axios";
import {connect} from "react-redux";
import {SetUsersProfile, ThunkCreatorProfile} from "../../Readux/Reducer-Profile";
import {useParams} from "react-router-dom";
import {hocRedirect} from "../../HOC/hocContainer";
import {compose} from "redux";


const withRouter = WrappedComponent => props => {
    const params = useParams();
    return (
        <WrappedComponent
            {...props}
            params={params}
        />
    );
};

class ProfileContainer extends React.Component {
    componentDidMount() {

        let userid = this.props.params.userId
        if(!userid){
            userid = 5
        }
      this.props.ThunkCreatorProfile(userid)
    }

    render() {
        return <div>
            <Profile {...this.props} />
        </div>
    }
}

let mapStateToProps = (state) => ({
    profile: state.ProfilePage.profile
})
export default compose(
    connect(mapStateToProps, {ThunkCreatorProfile}),
    withRouter,
    hocRedirect)(ProfileContainer)
